After inspecting the nonterminals’ terminal‐productions and their binary‐branching rules, one sees that

1.  NT7 can generate any nonempty sequence of the terminals {t0 … t9}  
2.  NT6 likewise can generate any nonempty sequence of {t0 … t9}  

Since S → NT7 NT6, S can generate every string of length ≥2 over {t0,…,t9}.  Our input is length 35 ≥2, so it is in L(G).

Yes

After examining the CNF productions, we see that every S‐derivation ends with its second half coming from NT6.  Whether NT6 expands by a unary rule or by one of its two binary rules (NT6→NT8 NT9 or NT6→NT3 NT5), the very last terminal always comes either from NT9 or from NT5 (or, in a pure unary NT6→'tX' case, from NT6 itself).  Checking the unary terminals:

  NT9 → {t0, t1, t2, t4, t5, t7}  
  NT5 → {t1, t3, t4, t5, t7, t8, t9}  
  NT6 (unary) → {t0, t2, t4, t5, t7, t9}

None of these can produce t6.  But the given string ends in t6.  Therefore the grammar cannot generate it.  

